const Ajv = require('ajv');

const ajv = new Ajv();

function testFunc(vData, schema) {
    for (const data of vData) {
        const validate = ajv.validate(schema, data);
        console.log(validate);
    }
}

console.log('html');
const schema1 = { type: 'string', contentMediaType: 'text/html' };
const vData1 = ['<!DOCTYPE html><html xmlns="http://www.w3.org/1999/xhtml"><head></head></html>'];
testFunc(vData1, schema1);

console.log('png');
const schema2 = { type: 'string', contentEncoding: 'base64', contentMediaType: 'image/png' };
const vData2 = [
    '',
];
testFunc(vData2, schema2);
